sys_variable_value.value:
(function execute(inputs, outputs) {
    var vpc = new GoogleVPCUtils();
    vpc.validateInputVariables(inputs, outputs);
    vpc.validateMandatoryVariables(inputs, ['name', 'projectid']);
    vpc.maptoOutputFromInput(inputs, outputs, ['projectid']);
    var requestBody = {
        'name': inputs.name.toLowerCase(),
        "networkTier": "PREMIUM",
        "ipVersion": inputs["ipVersion"]
    };
    if (inputs["description"])
        requestBody["description"] = inputs["description"];
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

